(625, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:55:\"Capture Hearts and Sales With Our Valentines Day Kit\";s:7:\"excerpt\";s:185:\"Our new Valentine\'s Day Kit is full of wonderful landing pages, sections, popups, and vector assets to help you quickly get your website ready for the most romantic holiday of the year.\";s:7:\"created\";i:1642422001;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:118:\"https://elementor.com/blog/valentines-day-kit/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:55:\"How To Create a Content Marketing Strategy From Scratch\";s:7:\"excerpt\";s:208:\"A clear content strategy is crucial to stand out and drive business results in an increasingly saturated marketplace. In this guide, we\'ll walk you through the steps of creating a successful content strategy.\";s:7:\"created\";i:1642091419;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:126:\"https://elementor.com/blog/content-marketing-strategy/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:66:\"A Look at Your Favorite Elementor Features and Offerings From 2021\";s:7:\"excerpt\";s:250:\"Back in November, we asked you which of the features or offerings released in 2021 were your favorite. As we reviewed the results we also took the time to reflect on what weve done in the past year to see how far weve come, lets take a look.\";s:7:\"created\";i:1641715922;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:132:\"https://elementor.com/blog/your-top-features-offerings-2021/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:41:\"End-of-Year Showcase 2021  the Winners\";s:7:\"excerpt\";s:189:\"From an initial pool of over 100 hopefuls to a shortlist of 30, weve finally arrived at the moment youve all been waiting for  announcing the Top 10 Elementor Websites of the Year!\";s:7:\"created\";i:1641387548;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:137:\"https://elementor.com/blog/end-of-year-showcase-2021-the-winners/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:38:\"10 Web Design Trends To Expect in 2022\";s:7:\"excerpt\";s:236:\"2021 was a crazy year to say the least. Lets pause for a moment to wrap things up and see what the future holds by taking a sneak peek into next years top design fads. Weve selected upcoming 10 trends to spark your imagination.\";s:7:\"created\";i:1640049600;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:117:\"https://elementor.com/blog/web-design-trends/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
